import { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

const App = () => {
  const [todos, setTodos] = useState([]);
  const [todo, setTodo] = useState("");

  return (
    <div className="App">
      <h1>TCSMGMT</h1>

      <form>
        <input type="text" name="todo" placeholder="Create new todo"></input>
      </form>

      <ul className="todo-list">
        {todos.map((todo))}
      </ul>
    </div>
  );
};

export default App;
